import { useContex } from './App'

export default function ComponentC() {
  return (
    <div>
        <useContex.Provider>
            {
                user =>{
                    return (
                        <div>UserContex value {user}</div>
                    )
                }
            }
        </useContex.Provider>
    </div>
  )
}
